import classes from "./Header.module.css"

function Terms() {
    return (
        <div className={classes.wrap}>
            <p className={`${classes.title}`}>TERMENI ȘI CONDIȚII</p>
            <p className={`${classes.subtitle}`}>Despre noi</p>
            <p className={`${classes.text}`}>Salut și bine ai venit pe www.bookcoffee.ro, site-ul oficial al companiei Book Coffeeshop SRL, persoană juridică, cu sediul social în Strada Sf. Ioan, Nr.  24, Brașov, CUI 41099816, înregistrat la Registrul Comerțului sub numărul J08/1669/13.05.2019, având cont bancar la: ING Bank București Centrala, RO 95INGB0000999909152606 și cod poștal 500030, prin intermediul căruia sunt oferite serviciile companiei.</p>
        </div>
    )
}

export default Terms;
